import React from 'react';
import {HeadersTextLists} from "../store/HeadersTextLists";
import TextButton from "../../text/TextButton";
import close from  "../../../../image/close.svg";
function OpenMobileHeader(props) {
    const style = {
        position: 'absolute'
    }

    const positionMainFunctions = [];
    //
    const componentsList = HeadersTextLists.map((e) => {
        return <TextButton text={e}/>
    });
    return (
        <div style={{
            position: "absolute",
            width:"100%",
            backgroundColor:"white",
            top:0,
            textAlign: "center"
        }} >
            <img src={close} style={{
                width:"8%"
            }}/>
            {componentsList}
        </div>
    );
}

export default OpenMobileHeader;
